import React, { Component, Fragment } from 'react';

class PlaylistInfo extends Component {
    render(){
        return(
            <Fragment>
                <div className="playlist-wrapper">
                    <img src="" alt="background" className="background" key="bgc"/>
                </div>
            </Fragment>
        )
    }
}
